  return (
    <View style={styles.telaPrincipal}>
      <View>
        {/* cadastro lembretes */}
        <TextInput placeholder="Lembrar..." style={styles.lembreteTxt}/>
        <Button title="Adicionar"/>
      </View>

      <View>
        {/* lembretes */}
      </View>  
    </View>
  );
}

const styles = StyleSheet.create({
  telaPrincipal: {
    flex: 1,
    backgroundColor: '#fff',
